import React from "react";
import { Route, BrowserRouter as Router, Routes } from "react-router-dom";
import Sectores from "./Sectores"; // Importa el componente

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Sectores />} /> {/* Página principal */}
        <Route path="/asientos3d/:id" element={<h2>Vista 3D en construcción...</h2>} /> {/* Simulación */}
      </Routes>
    </Router>
  );
}

export default App;
